import axios from "axios";

const API_URL = "http://localhost:8080/api";

// Đăng ký
export const register = async (data) => {
  return axios.post(`${API_URL}/register`, data);
};

// Đăng nhập
export const login = async (data) => {
  return axios.post(`${API_URL}/login`, data);
};
